import { Link } from "react-router-dom";

export default function IndexMovieTheaters() {
    return (
        <>
            <h3>Movie Theaters</h3>
             <br />
            <Link className="btn btn-primary" to="/movietheaters/create">Create movie theater</Link>       
        </>
    )
}
